func TestFindPimesInFib1(t *testing.T) {
	Convey("1", t, func() {
		arr := []int{9, 7, 5}
		res := MaxLength(arr, 3)
		So(res, ShouldEqual, 5)
	})
}

func TestFindPimesInFib2(t *testing.T) {
	Convey("1", t, func() {
		arr := []int{9, 7, 5}
		res := MaxLength(arr, 22)
		So(res, ShouldEqual, 0)
	})
}

